
def numSubarraysWithSum( nums: list[int], goal: int) -> int:
    non_empty_subarrays:int = 0
    sub_sum:int = 0
    freq:dict[int:int] = {}

    for number in nums:
        sub_sum += number

        if sub_sum == goal:
            non_empty_subarrays += 1

        if sub_sum - goal in freq:
            non_empty_subarrays += freq[sub_sum - goal]

        freq[sub_sum] = freq.get(sub_sum, 0) + 1
            
    return non_empty_subarrays


nums:list[int] = [1,0,1,0,1]
goal:int = 2

assert numSubarraysWithSum(nums, goal) == 4

